class Solution(object):
    def sub_find_sub(self, s, words):
        if len(words) == 0: return True
        if len(words) == 1:
            if s[:len(words[0])] == words[0]: return True
            return False

        len_word = len(words[0])
        for i in range(len(words)):
            if s[:len_word] == words[i]:
                cur_result = self.sub_find_sub(s[len_word:], words[:i] + words[i + 1:])
                if cur_result == True: return True
        return False


    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]n
        :rtype: List[int]
        """
        if len(words) == 0: return []
        if len(words) * len(words[0]) > len(s): return []


        words_dict = {}
        for i in range(len(words)):
            if words[i] in words_dict.keys(): words_dict[words[i]] += 1
            else: words_dict[words[i]] = 1

        final_result = []
        len_sub = len(words) * len(words[0])
        len_word = len(words[0])
        for i in range(len(s) - len_sub + 1):
            window_words_dict = {key:0 for key, val in words_dict.items()}
            flag = True
            for j in range(i, i + len_sub, len_word):
                if s[j:j + len_word] in window_words_dict.keys():
                    window_words_dict[s[j:j + len_word]] += 1
                else:
                    flag = False
                    break
            if flag == True:
                all_right = True
                for key, val in words_dict.items():
                    if val != window_words_dict[key]:
                        all_right = False
                        break
                if all_right == True:
                    final_result.append(i)
        return final_result




